func testFolderToManyAddOpParentFolders(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Folder
	var b, c, d, e Folder

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, folderDBTypes, false, strmangle.SetComplement(folderPrimaryKeyColumns, folderColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Folder{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, folderDBTypes, false, strmangle.SetComplement(folderPrimaryKeyColumns, folderColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*Folder{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddParentFolders(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.FolderID, first.ParentID) {
			t.Error("foreign key was wrong value", a.FolderID, first.ParentID)
		}
		if !queries.Equal(a.FolderID, second.ParentID) {
			t.Error("foreign key was wrong value", a.FolderID, second.ParentID)
		}

		if first.R.Parent != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Parent != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.ParentFolders[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.ParentFolders[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.ParentFolders().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

