func testFolderToOneFolderUsingParent(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Folder
	var foreign Folder

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, folderDBTypes, true, folderColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Folder struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, folderDBTypes, false, folderColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Folder struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&local.ParentID, foreign.FolderID)
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.Parent().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if !queries.Equal(check.FolderID, foreign.FolderID) {
		t.Errorf("want: %v, got %v", foreign.FolderID, check.FolderID)
	}

	ranAfterSelectHook := false
	AddFolderHook(boil.AfterSelectHook, func(ctx context.Context, e boil.ContextExecutor, o *Folder) error {
		ranAfterSelectHook = true
		return nil
	})

	slice := FolderSlice{&local}
	if err = local.L.LoadParent(ctx, tx, false, (*[]*Folder)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Parent == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.Parent = nil
	if err = local.L.LoadParent(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.Parent == nil {
		t.Error("struct should have been eager loaded")
	}

	if !ranAfterSelectHook {
		t.Error("failed to run AfterSelect hook for relationship")
	}
}

